import React, { useEffect, useState } from 'react'
const App = () => {
  const [what, setWhat]=useState("happy");

  useEffect(()=>{
    console.log(`it's ${what}`);
  },[what])

  return (
    <React.Fragment>
        I'm {what}
        <button onClick={()=>setWhat('sad')}>sad</button>
        <button onClick={()=>setWhat('happy')}>sad</button>
    </React.Fragment>
  )
}

export default App
